import React from 'react';
import './Footer.css';

const Footer = () => {
    return (
        <footer className="footer">
            <div className="container">
                <span>&copy; 2023 Strouffen Company. All rights reserved.</span>
            </div>
        </footer>
    );
};

export default Footer;
